window.bookSummaryJSON = "<p>Blunt, shocking, and sometimes profane, this exciting audiobook blasts self-help and feel-good remedies to expose the lies with which we imprison ourselves. It talks straight, hard, and true to the heart of the human condition, pulling no punches. It gives us simple yet revolutionary tools to break out of our minds and into a direct and immediate perception of exactly where we are - then shows us how we can together create a world that works for everyone.</p> <p>The audiobook is divided into five sections:</p> <p></p> <ol> <li>True Individuality</li> <li>Community and Compassion</li> <li>Creating Your Own Destiny</li> <li>How to Speak and Listen Your Projects into Reality</li> <li>Paradigms and Contexts: The Revolution of Consciousness as Political Change</li> </ol>"; 
